import styles from './Card.module.scss';
import CardForm from '../CardForm/CardForm';

const Card = props => {
  return (
    <div>
      <ul className={styles.cards}>
        {props.cards.map(card => <Card key={card.id} title={card.title} />)}
      </ul>
      <CardForm action={addCard} />
    </div>
  );
};

export default Card;
